import React from 'react';
import {AppBar, Button, Toolbar} from '@material-ui/core';
import './Footer.css';
import './Button.css';
import GithubPic from "../assets/GitHubPic.png";
import GithubLogo from "../assets/GitHubLogo.png";
import YouTube from "../assets/youtube.png";

class Footer extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
          <div>
                <br/><br/><hr/><br/>
                <div className="footer">
                    <div className="text">Designed by Lucas Pao</div>
                    <a className="github" href="https://github.com/lucaspingpao" target="_blank">
                        <img src={GithubLogo}></img>
                        <img src={GithubPic}></img>
                    </a>
                    <a className="logo" href="https://www.youtube.com/channel/UCm0a7WR5C2684z6fL5XNodw" target="_blank">
                        <img src={YouTube}></img>
                    </a>
                </div>
                <br/><hr/><br/>
          </div>
        );
    }
}

export default Footer;
